window.bookSummaryJSON = "<p><b>A swashbuckling adventure set in a version of Alexandre Dumas's world haunted by vampires . . .</b><br> <br> Morgane grew up at sea, daughter of the fierce pirate captain of the <i>Vengeance</i>, raised to follow in her footsteps as scourge of the Four Chains Trading Company. But when Anna-Marie is mortally wounded in battle, she confesses to Morgane that she is not her mother.<br> <br> The captain of the enemy ship reveals he was paid to kill Anna-Marie and bring Morgane home to France and her real family. Desperate to learn the truth about her lineage, Morgane spares him, leaving the <i>Vengeance</i> and everything she knows behind.<br> <br> Her quest reveals a world of decadence and darkness, in which monsters vie for control of royal courts and destinies of nations. She discovers the bloody secrets of the Four Chains Trading Company, and the truth about her real mother's death, nearly twenty years before . . .</p>"; 
